        //     </Menu>
        // </div>
        <Menu>
                <h4>Hello {data && `${data.firstName} ${data.lastName}`}</h4>
                <br></br>
                {/* <h4>Hello {currentUser && `${currentUser.firstName} ${currentUser.lastName}`}</h4> */}
                <Button style={{marginTop:'5px'}} onClick={() =>logout()}>Logout</Button>
        </Menu>
    )
    
}
